export async function seedRobotModels() {
  console.log("Seeding robot models...");
  try {
    // 1. Seed existing static models
    // Upsert models from data
    if (robotModelsData.length > 0) {
      await db.insert(robotModelsTable).values(robotModelsData).onConflictDoNothing();
    }

    const dirToRobotId = new Map<string, number>();

    // Refresh map from DB or use seeded data if we trust it matches DB ids (if we inserted hardcoded IDs)
    // To be safe, let's query the DB for the IDs of the models we know about
    const allModels = await db.select().from(robotModelsTable);
    for (const m of allModels) {
      dirToRobotId.set(m.dirName, m.id);
    }

    // Process Robots (Ensure Simulated version exists)
    for (const r of robotModelsData) {
      const modelId = dirToRobotId.get(r.dirName);
      if (modelId) {
        // Upsert simulated robot
        const existingRobot = await db.select().from(robotsTable).where(
          and(
            eq(robotsTable.robotModelId, modelId),
            eq(robotsTable.modality, 'simulated')
          )
        );

        if (existingRobot.length === 0) {
          await db.insert(robotsTable).values({
            name: r.name,
            modality: 'simulated',
            robotModelId: modelId,
            data: { type: 'simulation' }
          });
        }
      }
    }

    // Process Scenes
    for (const c of scenesData) {
      // @ts-ignore
      const scenePath = c.sceneXmlPath;
      const existingConfig = await db.select().from(scenesTable).where(
        eq(scenesTable.sceneXmlPath, scenePath)
      );

      let configId = existingConfig.length > 0 ? existingConfig[0].id : null;

      if (!configId) {
        const [insertedConfig] = await db.insert(scenesTable).values({
          name: c.name,
          sceneXmlPath: scenePath
        }).returning();
        configId = insertedConfig.id;
      }

      if (configId) {
        // Link robots
        // @ts-ignore
        if (c.includedRobots && Array.isArray(c.includedRobots)) {
          // @ts-ignore
          for (const robotDirName of c.includedRobots) {
            const robotModelId = dirToRobotId.get(robotDirName);
            if (robotModelId) {
              const robots = await db.select().from(robotsTable).where(
                and(
                  eq(robotsTable.robotModelId, robotModelId),
                  eq(robotsTable.modality, 'simulated')
                )
              );

              if (robots.length > 0) {
                const robot = robots[0];
                await db.insert(sceneRobotsTable).values({
                  sceneId: configId,
                  robotId: robot.id,
                  snapshot: robot
                }).onConflictDoNothing();
              }
            }
          }
        }
      }
    }

    // Update the sequence to match the highest ID so subsequent inserts relying on default ID work
    await db.execute(sql`SELECT setval(pg_get_serial_sequence('robot_models', 'id'), (SELECT MAX(id) FROM robot_models))`);

    console.log("Seeding complete.");
  } catch (error) {
    console.error("Error seeding robot models:", error);
  }
}
